import "./Login.modules.css";

export default function Login() {
    function handleForm(e) {
        e.preventDefault();
        console.log(e.target.email.value);
        console.log(e.target.password.value);
    }

    return (
        <form>
            <button onClick={handleForm}>Click</button>
        </form>
    )
}
